import "./HomePage.css";
import { Link } from "react-router-dom";

function HomePage() {
  return (
    <>
      <div>
        <h1>
          <span>빙고로 알아보는</span>
          <br /> <span>나의</span>
          <span>진짜!</span>
          <span>MBTI</span>
        </h1>
        <Link to={"/profile"}>시작하기</Link>
      </div>
    </>
  );
}

export default HomePage;
